import React from "react";
import './Style/COMCards.css'

const COMCards = (props) => {
    return(
        <>
            <div className="COMMain">
                <div className="COMTop">
                    <embed style={{width:'00%', height:'90%'}} src={props.embed} type="" />
                </div>
            </div>
        </>
    )
}

export { COMCards }
